import React from 'react'
import {Link} from 'react-router-dom'
const Info = () => {
    return (
        <div>
            <p className = "email">Email: alw245@pitt.edu</p>
            <img src = "Twitter_Logo_WhiteOnBlue.png" alt = "twitter"></img> <Link 
            to = "twitter.com/notPaff" onClick = {(event) => {
                event.preventDefault(); window.open(this.makeHref("twitter.com/notPaff"))
            }}></Link>
        </div>
    )
}

export default Info
